create table user (
	username varchar(32) not null,
	password varchar(32) not null,
	fName varchar(32) not null,
	lName varchar(32) not null,
	address varchar(128) not null,
	city varchar(64) not null,
	state varchar(64) not null,
	postcode int not null,
        phoneNumber varchar(20) not null,
	primary key (username)
);



create table provider (
	username varchar(32) not null,
	rating double(3,2) not null,
	amount double(10,2) not null,
	primary key (username),
	foreign key (username) references user(username)
);


create table serviceOffering (
	serviceID int not null,
	serviceName varchar(64) not null,
        serviceLocation varchar(200) not null,
	serviceDescription varchar(2048) not null,
	serviceCost double not null,
	serviceRating double not null,
        ratingOccur int not null,
	providerName varchar(32) not null,
	primary key (serviceID),
	foreign key (providerName) references provider(username)
);



update serviceoffering set ratingOccur=1 where serviceID>10 AND serviceID<=100;

create table serviceRequest(
	requestID int not null,
	serviceID int not null,
	requester varchar(32) not null,
	requestTime TIMESTAMP not null,
	serviceTime TIMESTAMP not null,
        durationHour int not null,
        durationMinute int not null,
        address varchar(128) not null,
	primary key (requestID),
	foreign key (serviceID) references serviceOffering(serviceID) on delete cascade,
	foreign key (requester) references user(username)
);



create table completedRequest (
	requestID int not null,
	finishTime TIMESTAMP not null,
	feedback varchar(2048),
	requestRating int,
	primary key (requestID),
	foreign key (requestID) references serviceRequest(requestID) on delete cascade
);












create table transaction(
	transactionID int not null,
	requestID int,
        transactionTime TIMESTAMP not null,
	payee varchar(32) not null,
	payer varchar(32) not null,
	payAmount double not null,
	
	primary key (transactionID),
	foreign key (requestID) references serviceRequest(requestID) on delete set NULL on update cascade,
	foreign key(payee) references user(username),
	foreign key (payer) references provider(username)
);



create table card (
	cardNumber varchar(20) not null,
	type varchar(20) not null,
	nameOnCard varchar(32) not null,
	expiryDate TIMESTAMP not null,
	cvv int not null,
	username varchar(32) not null,
        amount double not null,
	primary key(cardNumber),
	foreign key (username) references user(username)
);



